export const GET_CLASSES = '[profile] GET_CLASSES';
export const LOADING_CLASSES = '[profile] LOADING_CLASSES';
export const CLASSES_SUCCESS = '[profile] CLASSES_SUCCESS';
export const CLASSES_ERROR = '[profile] CLASSES_ERROR';

export const getClasses = () =>({
  type: GET_CLASSES
});

export const loadingClasses = () =>({
  type: LOADING_CLASSES
});

export const classesSuccess = (payload) =>({
  type: CLASSES_SUCCESS,
  payload
});

export const classesError = (payload) =>({
  type: CLASSES_ERROR,
  payload
});
